        await axios.get('http://somweb.cf:8000/wn-site')
        .then((value)=>{
            setMapData(value.data.data);
        }).catch(()=>{
            throw Error;
        });
    };

    const Processing = mapData.map((value)=>{
        console.log(value);
        console.log(value.lat);
        console.log(value.lng);
    })

    return (
        <div className="map">
            <LoadScript googleMapsApiKey="AIzaSyDevvetng60XedeOqk-qW9TF-XBNQsyxdE">
                <GoogleMap
                    mapContainerStyle={style}
                    center={center}
                    zoom={12}
                >
                    {
                        point.map((value)=>{
                            return <Marker position={value}/>
                        })
                    }
                </GoogleMap>
            </LoadScript>
        </div>
    );
}

export default Map;
